import React from "react";
import classes from "./Quote.module.css"
import Card from "./card";

const Quotes=(props)=>{
  return (
    <Card className={props.className}>
        <p className={classes.quote}>{props.quote}</p>
    </Card>
  )
}

export default Quotes;
